import React from "react";
import styled from "styled-components";

type data = {
    x: {
        id: number,
        title:  string,
        client: string,
        due: string,
        count: number,
        amount: number,
        method: [],
        material: [],
        status: string
    };
  }

const Content: React.FC<data> = props =>{

    return (
       <Container>
        <Info>
       <Project>
           {props.x.title}
       </Project>
       <Client>
           {props.x.client}
       </Client>
       <Day>
       {props.x.due}
       </Day>
       </Info>
       <InfoTable>
           <Menu>
               <tr> 도면 개수</tr>
               <tr> 총 수량</tr>
               <tr> 가공방식</tr>
               <tr> 재료</tr>
           </Menu>
           <Data>
               <tr>{props.x.count}</tr>
               <tr>{props.x.amount}</tr>
               <tr>{props.x.method}</tr>
               <tr>{props.x.material.join(", ")}</tr>
           </Data>
       </InfoTable>

       <Button>
           <Request>
               요청 내역 보기
           </Request>
           <Chat>
               채팅하기
           </Chat>
       </Button>
       </Container>
    )
}
export default Content

const Container =styled.div`
width: 15rem;
